import logo from './logo.svg';
import './App.css';

function Test(props) {
  return (
    <div>
      <p>It is currently: {props.date.toLocaleTimeString()}.</p>
    </div>
  );
}

function App() {
  return (
    <p>Head: </p>,
    <Test name="Ray" age="22" />
  );
}

export default App;
